function addDates(dates) {
  dates.forEach(date => {
    combined.push({"date": date})
  })
}


function addKeyWithValues(key, values) {
  for (var i = 0; i < combined.length; i++) {
    combined[i][key] = values[i]
  }
}

/** add missing data as 0 before provided data */
function stuffValues(values) {
  let startsAt = labels.length - values.length -1
  if (startsAt < 0) startsAt = 0
  let valueIndex = 0
  return Array(labels.length).fill(0).map((value, i) => {
    if (i > startsAt) {
      return values[valueIndex++]
    } else {
      return value
    }
  })
}

function addLineChartusers(key, values) {
  // if (labels.length === values.length) {
    // addDates(labels)
  // } else {
  //   addDates(labels.slice(startsAt - 1, labels.length - 1 ))
  // }
  addDates(labels)
  addKeyWithValues(key, stuffValues(values))
}


function addLineChartusersactive(key, values) {
  addKeyWithValues(key, stuffValues(values))
}

function addLineChartpods(key, values) {
  addKeyWithValues(key, stuffValues(values))
}

function addLineChartcomments(key, values) {
  addKeyWithValues(key, stuffValues(values))
}

function addLineChartposts(key, values) {
  addKeyWithValues(key, stuffValues(values))
}

